
/*Criação do Banco de Dados com Dados Ficticios*/
CREATE DATABASE BD_Corretora
GO

USE BD_Corretora
GO

CREATE TABLE Seguradoras (
  idSeguradoras INTEGER  NOT NULL   IDENTITY ,
  Seguradora VARCHAR(15)  NOT NULL    ,
PRIMARY KEY(idSeguradoras));
GO




CREATE TABLE Ramos (
  idRamos INTEGER  NOT NULL   IDENTITY ,
  Ramo VARCHAR(20)  NOT NULL    ,
PRIMARY KEY(idRamos));
GO




CREATE TABLE Estado (
  idEstado INTEGER  NOT NULL   IDENTITY ,
  Estado VARCHAR(15)  NOT NULL    ,
PRIMARY KEY(idEstado));
GO




CREATE TABLE Telefone (
  idTelefone INTEGER  NOT NULL   IDENTITY ,
  Numero VARCHAR(30)  NOT NULL    ,
PRIMARY KEY(idTelefone));
GO




CREATE TABLE Bairro (
  idBairro INTEGER  NOT NULL   IDENTITY ,
  Bairro VARCHAR(15)  NOT NULL    ,
PRIMARY KEY(idBairro));
GO




CREATE TABLE Cidade (
  idCidade INTEGER  NOT NULL   IDENTITY ,
  Cidade VARCHAR(15)  NOT NULL    ,
PRIMARY KEY(idCidade));
GO




CREATE TABLE Endereco (
  idEndereco INTEGER  NOT NULL   IDENTITY ,
  Bairro_idBairro INTEGER  NOT NULL  ,
  CEP VARCHAR(30)  NOT NULL  ,
  Logradouro VARCHAR(70)  NOT NULL    ,
PRIMARY KEY(idEndereco)  ,
  FOREIGN KEY(Bairro_idBairro)
    REFERENCES Bairro(idBairro));
GO


CREATE INDEX Endereco_FKIndex1 ON Endereco (Bairro_idBairro);
GO


CREATE INDEX IFK_Fica1 ON Endereco (Bairro_idBairro);
GO


CREATE TABLE Cidade_has_Bairro (
  Cidade_idCidade INTEGER  NOT NULL  ,
  Bairro_idBairro INTEGER  NOT NULL    ,
PRIMARY KEY(Cidade_idCidade, Bairro_idBairro)    ,
  FOREIGN KEY(Cidade_idCidade)
    REFERENCES Cidade(idCidade),
  FOREIGN KEY(Bairro_idBairro)
    REFERENCES Bairro(idBairro));
GO


CREATE INDEX Cidade_has_Bairro_FKIndex1 ON Cidade_has_Bairro (Cidade_idCidade);
GO
CREATE INDEX Cidade_has_Bairro_FKIndex2 ON Cidade_has_Bairro (Bairro_idBairro);
GO


CREATE INDEX IFK_Fica3 ON Cidade_has_Bairro (Cidade_idCidade);
GO
CREATE INDEX IFK_Fica2 ON Cidade_has_Bairro (Bairro_idBairro);
GO


CREATE TABLE Cidade_has_Estado (
  Cidade_idCidade INTEGER  NOT NULL  ,
  Estado_idEstado INTEGER  NOT NULL    ,
PRIMARY KEY(Cidade_idCidade, Estado_idEstado)    ,
  FOREIGN KEY(Cidade_idCidade)
    REFERENCES Cidade(idCidade),
  FOREIGN KEY(Estado_idEstado)
    REFERENCES Estado(idEstado));
GO


CREATE INDEX Cidade_has_Estado_FKIndex1 ON Cidade_has_Estado (Cidade_idCidade);
GO
CREATE INDEX Cidade_has_Estado_FKIndex2 ON Cidade_has_Estado (Estado_idEstado);
GO


CREATE INDEX IFK_Fica4 ON Cidade_has_Estado (Cidade_idCidade);
GO
CREATE INDEX IFK_Fica5 ON Cidade_has_Estado (Estado_idEstado);
GO


CREATE TABLE Clientes (
  idClientes INTEGER  NOT NULL   IDENTITY ,
  Endereco_idEndereco INTEGER  NOT NULL  ,
  Nome_Cliente VARCHAR(50)  NOT NULL  ,
  Email VARCHAR(50)  NOT NULL  ,
  End_Num INTEGER  NOT NULL  ,
  Complemento VARCHAR(25)  NOT NULL    ,
PRIMARY KEY(idClientes)  ,
  FOREIGN KEY(Endereco_idEndereco)
    REFERENCES Endereco(idEndereco));
GO


CREATE INDEX Clientes_FKIndex1 ON Clientes (Endereco_idEndereco);
GO


CREATE INDEX IFK_Mora ON Clientes (Endereco_idEndereco);
GO


CREATE TABLE Clientes_has_Telefone (
  Clientes_idClientes INTEGER  NOT NULL  ,
  Telefone_idTelefone INTEGER  NOT NULL    ,
PRIMARY KEY(Clientes_idClientes, Telefone_idTelefone)    ,
  FOREIGN KEY(Clientes_idClientes)
    REFERENCES Clientes(idClientes),
  FOREIGN KEY(Telefone_idTelefone)
    REFERENCES Telefone(idTelefone));
GO


CREATE INDEX Clientes_has_Telefone_FKIndex1 ON Clientes_has_Telefone (Clientes_idClientes);
GO
CREATE INDEX Clientes_has_Telefone_FKIndex2 ON Clientes_has_Telefone (Telefone_idTelefone);
GO


CREATE INDEX IFK_Tem ON Clientes_has_Telefone (Clientes_idClientes);
GO
CREATE INDEX IFK_Tem2 ON Clientes_has_Telefone (Telefone_idTelefone);
GO


CREATE TABLE Propostas (
  idPropostas INTEGER  NOT NULL   IDENTITY ,
  Ramos_idRamos INTEGER  NOT NULL  ,
  Seguradoras_idSeguradoras INTEGER  NOT NULL  ,
  Clientes_idClientes INTEGER  NOT NULL  ,
  Prop_Num VARCHAR(30)  NOT NULL  ,
  Data_Transmissao DATE  NOT NULL  ,
  Inicio_Vig DATE  NOT NULL  ,
  Vencimento DATE  NOT NULL  ,
  Premio_Total DECIMAL  NOT NULL    ,
PRIMARY KEY(idPropostas)      ,
  FOREIGN KEY(Clientes_idClientes)
    REFERENCES Clientes(idClientes),
  FOREIGN KEY(Seguradoras_idSeguradoras)
    REFERENCES Seguradoras(idSeguradoras),
  FOREIGN KEY(Ramos_idRamos)
    REFERENCES Ramos(idRamos));
GO


CREATE INDEX Propostas_FKIndex1 ON Propostas (Clientes_idClientes);
GO
CREATE INDEX Propostas_FKIndex2 ON Propostas (Seguradoras_idSeguradoras);
GO
CREATE INDEX Propostas_FKIndex3 ON Propostas (Ramos_idRamos);
GO


CREATE INDEX IFK_Faz ON Propostas (Clientes_idClientes);
GO
CREATE INDEX IFK_Pertence ON Propostas (Seguradoras_idSeguradoras);
GO
CREATE INDEX IFK_Tem3 ON Propostas (Ramos_idRamos);
GO


CREATE TABLE PF (
  idPF INTEGER  NOT NULL   IDENTITY ,
  Clientes_idClientes INTEGER  NOT NULL  ,
  CPF VARCHAR(11)  NOT NULL  ,
  Nascimento DATE  NOT NULL    ,
PRIMARY KEY(idPF, Clientes_idClientes)  ,
  FOREIGN KEY(Clientes_idClientes)
    REFERENCES Clientes(idClientes));
GO


CREATE INDEX PF_FKIndex1 ON PF (Clientes_idClientes);
GO


CREATE INDEX IFK_Rel_02 ON PF (Clientes_idClientes);
GO


CREATE TABLE PJ (
  idPJ INTEGER  NOT NULL   IDENTITY ,
  Clientes_idClientes INTEGER  NOT NULL  ,
  CNPJ VARCHAR(14)  NOT NULL  ,
  Abertura DATE  NOT NULL    ,
PRIMARY KEY(idPJ, Clientes_idClientes)  ,
  FOREIGN KEY(Clientes_idClientes)
    REFERENCES Clientes(idClientes));
GO


CREATE INDEX PJ_FKIndex1 ON PJ (Clientes_idClientes);
GO


CREATE INDEX IFK_Rel_01 ON PJ (Clientes_idClientes);
GO


CREATE TABLE Apolice (
  idApolice INTEGER  NOT NULL   IDENTITY ,
  Propostas_idPropostas INTEGER  NOT NULL  ,
  Apol_Num VARCHAR(30)  NOT NULL  ,
  Emissao DATE  NOT NULL    ,
PRIMARY KEY(idApolice)  ,
  FOREIGN KEY(Propostas_idPropostas)
    REFERENCES Propostas(idPropostas));
GO


CREATE INDEX Apolice_FKIndex1 ON Apolice (Propostas_idPropostas);
GO


CREATE INDEX IFK_Gera ON Apolice (Propostas_idPropostas);
GO


